import React from "react";
import "./Home.css";
const Home = () => {
  return (
    <div>
      <h3>Guest-Book</h3>
      <p>Contact and Chat with your friends</p>
      <a href="/login">
        <button>Login</button>
      </a>
      <a href="/register">
        <button>Register</button>
      </a>
    </div>
  );
};

export default Home;
